import React from 'react';
import Form from './components/Form';
import Todo from './components/Todo';
// import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div>
        <Form />
        <ul>
          <li>
            <Todo text="hogehoge" />
          </li>
        </ul>
      </div>
    );
  }

}

export default App;
